import React, { Component } from "react";
import Layout from "../../components/Layout";
import { Form, Input } from "semantic-ui-react";

class AddUser extends Component {
  state = {
    value: "",
  };
  render() {
    return (
      <Layout>
        <Form>
          <Form.Input
            label="Full name"
            Placeholder="Enter full name"
            width={5}
          />
        </Form>
      </Layout>
    );
  }
}

export default AddUser;
